(()=>{var e;document.getElementById("ajaxButton").addEventListener("click",(function(){if(!(e=new XMLHttpRequest))return alert("XMLHTTP 인스턴스를 만들 수가 없어요 ㅠㅠ"),!1;e.onreadystatechange=()=>{e.readyState===XMLHttpRequest.DONE&&(200===e.status?document.querySelector(".chatting").innerHTML=e.responseText:404===e.status?alert("요청하신 페이지를 찾을 수 없어요 ㅠㅠ"+e.responseURL):alert("request에 뭔가 문제가 있어요."))},e.open("GET","./chat.html"),e.send()}))})();